# This is the cookie we want to use to "login" to the source site.
# Please substitute with your own.
# Note that the domain is the server that we are hitting.
# ALSO note that the user you are using should not have anything in 
# the shopping cart; that would mess up the result
# (An optimization in the code is to derive the cookie domain from the URL)
cookie=154NCT9G5WCR51C9BCL79DCRV01KGBZ3PJ6AP3P
cookieDomain=www1.dev.nyc1.freshdirect.com

# This is the cookie we want to use to "login" to the target site.
# Please substitute with your own.
# ALSO note that the user you are using should not have anything in 
# the shopping cart; that would mess up the result
# Note that the domain is the server that we are hitting.
targetCookie=154NCT9G5WCR51C9BCL79DCRV01KGBZ3PJ6AP3P
#targetCookieDomain=app1.dev.nyc1.freshdirect.com
targetCookieDomain=localhost

# When we get the data back from the server, we should
# ignore certain lines that will change from env to env.
# NOTE this uses regexp expressions, comma-separated
ignorePatterns=\
(.*)Store Version(.*),(.*)Server:(.*),(.*)OAS_query(.*),\
(.*)Delivery & Pickup Info(.*),(.*)within the next(.*),\
(.*)Product Summary(.*),(.*)ann+(.*)

# If we DON'T want to just remove the offending lines
# and want to just block out *portion* of lines, use these
# replacement patterns in
# <regexp>=<replacementstring> (comma-separated)
replacePatterns=\
;jsessionid(.*)\\?=?,rnd(.*)\\'=',rnd(.*)\\"="

# write out to a "log" file what we did
# for us this can just be a shell script in some temp location
diffLog=C:\\temp\\test\\diff.sh

# in the "log" file, we may want to prepend something
# the code will replace a DOS-friendly URL into the ?
# think of this as the beginning part of a line that will
# be used in the shell script.
diffLogPrepend=echo "*******COMPARING ?"; diff -siEbwB

# where we stuff all the files for the base
baseSource=C:/temp/test/working/int/

# where we stuff all the files for the target
targetSource=C:/temp/test/working/cms/

